//-----------------------------------------------------------------------------
// Implementation of a sound generator playing samples. Utilizes an array of samples
// and an array of sample references and the length they should be played.
// The sound files should be kept somewhere else in the file.
//-----------------------------------------------------------------------------

void init(void);
void next_note(void);

uint16_t* note_array[100];
uint16_t note_lens[100];

// Songs is an array (implicitly) consisting of triplets. for n = 3*k for k = integer:
// n = amount of times the sample should be played
// n+1 = the location of the sample
// n+2 = What to put on the LEDs
uint16_t* songs[1];
uint16_t song_lens[1];

typedef struct Player
{
	uint16_t song;		// Number of current song
	uint16_t song_len;	// The amount of notes the current song has
	uint16_t notes_played;	// The amount of notes that has been played		
	uint16_t sample_total;	// Describes how many times this notes sample should be played	
	uint16_t sample;	// Describes how many samples of a note has been played
	uint16_t sample_i;	// Describes where in the current sample the player is 
	uint16_t* note;		// A pointer to the location of the sample being played
	uint16_t LED;		// Describes how the LEDs should look
	uint16_t note_len;	// A description of the length of the current sample, to avoid cutoff popping.
} Player;

// You only segfault once
Player player;

// Sets up a new playback
void play_init(uint16_t new_song){
	init();

	player.song = new_song;		
	player.song_len = song_lens[new_song];

	player.notes_played = 0;
	player.sample_total = songs[player.song][0];
	player.sample = 0;
	player.sample_i = 0;	 
	player.note = note_array[songs[player.song][1]];
	player.LED = songs[player.song][2];
	player.note_len = note_lens[songs[player.song][1]];
}

void play(void){
	if(player.sample_i < player.note_len-1){			// SLEN: SAMPLE LENGTH
		player.sample_i++;					// Player is in the middle of a sample
	}
	else{								// Player has reached the end of a sample
		player.sample_i = 0;
		if(player.sample < player.sample_total){
   			player.sample++;				// Player has reached the end of a sample, and plays it again
		}
		else{							// Player has reached the end of a sample, and the sample was the last to be played for a note
			player.sample = 0;
			if(player.notes_played < player.song_len){
				next_note();
				(*GPIO_PA_DOUT) =  player.note_len << 8 ;		// Player loads the next node
			}			 
			else{
			  silence();
			}
		}
	}
	
	*DAC0_CH0DATA = player.note[player.sample_i];			// Puts the sampled voltage on the DAC
	*DAC0_CH1DATA = player.note[player.sample_i];
	//__asm("wfi");
}

// Sets sample_total, note and LED for next note
void next_note(void){
	player.notes_played++;
	uint16_t offset = player.notes_played*3;			// Since the song descriptor is a set of triplets we need the correct offset

	player.sample_total = songs[player.song][offset];		// Set the amount of samples to be played for next note
	player.note = note_array[songs[player.song][offset + 1]];	// Set the pointer to the sample of the next note
	player.LED = songs[player.song][offset + 2];			// Set the LED config
	player.note_len = note_lens[songs[player.song][offset + 1]];	// 
}


